2.10 객체의 속성과 메서드에 적용되는 특징을 알자

객체의 속성을 옵셔널로 쓰거나 readonly 로 만들 수 있다
interface World {
  name: string;
  people: number;
  readonly sky: boolean;
  pet?: boolean;
  // World.pet?: boolean | undefined
}

const world: World = {
  name: 'Wonderland',
  people: 10,
  sky: true,
};

world.sky = false;
// Cannot assign to 'sky' because it is a read-only property.


객체 리터럴을 대입할 때와 변수를 대입할 때의 타입 검사 방식이 달라진다
interface World {
  name: string;
}

const world: World = {
  name: 'Wonderland',
  people: 10,
  // Type '{ name: string; people: number; }' is not assignable to type 'World'.
  // Object literal may only specify known properties, and 'people' does not exist in type 'World'.
};

const obj = {
  name: 'Wonderland',
  people: 10,
};

const world2: World = obj;

function unityWorld(world1: World, world2: World): World {
  return { name: world1.name + world2.name };
}

unityWorld(obj, { name: 'hi', people: 10 });
// Argument of type '{ name: string; people: number; }' is not assignable to parameter of type 'World'.
// Object literal may only specify known properties, and 'people' does not exist in type 'World'.


객체 리터럴: 잉여 속성 검사(Excess Property Checking)
타입 선언에서 선언하지 않은 속성을 사용할 때 에러를 표시


변수: 객체 간 대입 가능성을 비교


구조 분해 할당 시 명시적 타입 타이핑에 유의하기
// ❌
const {
  props: { nested: string },
} = { props: { nested: 'hi' } };

// ⭕️
const {
  props: { nested },
}: { props: { nested: string } } = { props: { nested: 'hi' } };


특정 속성의 타입을 별도의 타입으로 만들기

인덱스 접근 타입(Indexed Access Type)
type Animal = {
  name: 'zebra' | 'lion';
};

type AnimalName = Animal['name'];
// type AnimalName = "zebra" | "lion"




객체의 키의 타입과 값의 타입 구하기

keyof 연산자 사용하기
const obj = {
  hello: 'world',
  name: 'ttaerrim',
  age: 24,
};

type Keys = keyof typeof obj;
type Values = (typeof obj)[Keys];




keyof

타입스크립트에서는 배열을 위해 객체의 키에 string, symbol + number 타입 허용type Keys = keyof any;
// type Keys = string | number | symbol


keyof 배열
모든 number → 이해가 잘 안 됨..
배열 속성 이름
length, forEach, lastIndexOf 등 배열의 공통 속성


배열 인덱스 문자열
[1, 2, 3] 이라면 인덱스인 '0' | '1' | '2'






인덱스 접근 타입으로 특정 키들의 값 타입 추리기
const obj = {
  hello: 'world',
  name: 'ttaerrim',
  age: 24,
};

type Values = (typeof obj)['hello' | 'name'];
// type Values = string


매핑된 객체 타입 별칭의 키로 사용하기
```tsx
// ❌
type HelloAndHi = {


[key: 'hello' | 'hi']: string;
// An index signature parameter type cannot be a literal type or generic type. Consider using a mapped object type instead
  };
  // ⭕️
  type HelloAndHi = {
[key in 'hello' | 'hi']: string;
  };

  ```tsx
  interface Original {
    name: string;
    age: number;
    married: boolean;
  }

  type Copy = {
    [key in keyof Original]: Original[key];
  };

  /**
  type Copy = {
      name: string;
      age: number;
      married: boolean;
  }
  */

keyof 연산자를 사용해 Original 의 속성 이름만 추릴 수 있다
인덱스 접근 타입으로 원래 객체의 타입을 가져온다
'name': Original['name'] 에서 string 을 가져옴
'age': Original['age'] 에서 number 을 가져옴
'married': Original['married'] 에서 boolean 을 가져옴




튜플에 매핑된 객체 타입 적용하기
```tsx
type Tuple = [1, 2, 3];
type CopyTuple = {


[Key in keyof Tuple]: Tuple[Key];
  };

  - 질문
    여기서 `Tuple[Key]` 안의 `Key` 는 왼쪽의 `Key in keyof Tuple` 에서 가져오는 건가?
  - 읽기 전용

    ```tsx
    interface Original {
      name: string;
      age: number;
      married: boolean;
    }

    type Copy = {
      readonly [key in keyof Original]: Original[key];
    };

옵셔널type Copy = {
  readonly [key in keyof Original]?: Original[key];
};


타입 제거type Copy = {
  -readonly [key in keyof Original]-?: Original[key];
};


-readonly: readonly 수식어 제거
-?: ? 수식어 제거


속성 이름 바꾸기
```tsx
type Copy = {

  [key in keyof Original as Capitalize]: Original[key];
};
```
2.11 타입을 집합으로 생각하자(유니언, 인터섹션)

타입스크립트를 집합 관계로 보기

가장 넓은 타입(전체 집합)은 unknown
가장 좁은 타입(공집합)은 never
유니언 연산자(|)는 합집합 역할
인터섹션 연산자(&)는 교집합 역할type nev = string & number;
// type nev = never;





✔️ 항상 좁은 타입에서 넓은 타입으로 대입해야 한다

any 타입은 집합 관계를 무시하므로 & , | 연산을 하지 않는 것이 좋다

null/undefined 를 제외한 자료형 & 비어 있지 않은 객체 ⇒ never 타입이 되지 않음
type H = { a: 'b' } & number;
// { a: 'b' } & number

type I = null & { a: 'b' };
// never

type J = {} & string;
// string


{}는 null과 undefined를 제외한 모든 값을 의미하는 타입이다



2.12 타입도 상속이 가능하다

상속을 사용하면 부모 객체에 존재하는 속성을 다시 입력하지 않아도 되므로 중복을 제거할 수 있다
& 연산자로 타입 상속하기
type Animal = {
  name: string;
};

type Dog = Animal & {
  bark(): void;
};

type Cat = Animal & {
  meow(): void;
};

type Name = Cat['name'];


타입 별칭이 인터페이스를 상속할 수 있고 인터페이스가 타입 별칭을 상속할 수도 있다
interface Animal {
  name: string;
}
type Dog = Animal & {
  bark(): void;
};
type Cat = Animal & {
  meow(): void;
};
type Name = Cat['name'];


타입 별칭으로 선언한 객체 타입과 인터페이스로 선언한 객체 타입이 호환된다


한 번에 여러 타입 상속하기
type Animal = {
  name: string;
};
interface Dog extends Animal {
  bark(): void;
}
interface Cat extends Animal {
  meow(): void;
}

interface DogCat extends Dog, Cat {}


상속할 때 부모 속성의 타입 변경하기
interface Merge {
  one: string;
  two: string;
}
interface Merge2 extends Merge {
  one: 'h' | 'w';
  two: '123';
}


부모에 대입할 수 있는 타입으로 좁히는 것은 가능하지만 완전히 다른 타입으로 변경하면 에러 발생interface Merge2 extends Merge {
  one: 'h' | 'w';
  two: 123;
}





2.13 객체 간에 대입할 수 있는지 확인하는 법을 배우자
interface A {
  name: string;
}
interface B {
  name: string;
  age: number;
}

const aObj = {
  name: 'zero',
};
const bObj = {
  name: 'nero',
  age: 32,
};

const aToA: A = aObj;
const bToA: A = bObj;
const aToB: B = aObj;
// Property 'age' is missing in type '{ name: string; }' but required in type 'B'.
const bToB: B = bObj;


B 타입에 A 타입 객체를 대입하는 것은 실패
A 타입에 B 타입을 대입하는 것은 좁은 타입을 넓은 타입에 대입하는 것이기 때문에 가능하다
여기서는 A 타입이 B 타입보다 넓은/추상적인 타입
B 타입이 A 타입보다 좁은/구체적인 타입


A | B 합집합은 A, B, A | B 각각의 집합과 교집합을 전부 대입할 수 없다

합집합은 각각의 집합보다 교집합보다 넓다




튜플은 배열보다 좁은 타입

튜플은 배열에 대입할 수 있으나 배열은 튜플에 대입할 수 없음

let a: ['hi', 'readonly'] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
// Type 'string[]' is not assignable to type "['hi', 'readonly']". Target requires 2 element(s) but source may have fewer


readonly 수식어가 붙은 배열이 더 넓은 타입
let a: readonly string[] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
b = a;
// Type type 'readonly ['hi', 'readonly'] is 'readonly' and cannot be assigned to the mutable type 'string[]'.


좁은 타입을 넓은 타입에 대입해야 하기 때문에~


readonly 튜플과 일반 배열 대입하기
let a: readonly ['hi', 'readonly'] = ['hi', 'readonly'];
let b: string[] = ['hi', 'normal'];

a = b;
// Type 'string[]' is not assignable to type 'readonly ["hi", "readonly"]'.
// Target requires 2 element(s) but source may have fewer.
b = a;
// The type 'readonly string[]' is 'readonly' and cannot be assigned to the mutable type 'string[]'.


a = b 배열이 튜플보다 넓은 타입
b = a
튜플이 배열보다 좁은 타입이지만
readonly 수식어가 붙으면 일반 배열보다 넓은 타입




옵셔널인 객체가 옵셔널이지 않은 객체보다 더 넓은 타입
type Optional = {
  a?: string;
  b?: string;
};

type Mandatory = {
  a: string;
  b: string;
};


Optional 타입보다 Mandatory 타입보다 넓은 타입이다
옵셔널은 기존 타입 | undefined


객체에서는 readonly 속성이 붙어도 서로 대입할 수 있다

객체의 readonly 속성은 타입의 범위에 영향을 끼치지 않음type ReadOnly = {
readonly a: string;
readonly b: string;
};
type Mandatory = {
a: string;
b: string;
};
const o: ReadOnly = {
a: 'hi',
b: 'world',
};
const m: Mandatory = {
a: 'hello',
b: 'world',
};
const o2: ReadOnly = m;
const m2: Mandatory = o;
// 모두 가능




모든 속성이 동일하면 객체 타입 이름이 달라도 동일한 타입으로 취급됨
→ 구조가 같으면 같은 객체로 인식하는 것을 구조적 타이핑(structural typing)이라고 함interface A {
  name: string;
}
interface B {
  name: string;
  age: number;
}


B 인터페이스는 A 인터페이스에 존재하는 모든 속성을 가지고 있기 때문에 구조적 타이핑 관점에서 A인터페이스라고 볼 수 있다
구조가 같아야만 동일한 것도 아니고, B가 A라고 해서 A도 B인 것도 아니다


배열에 매핑된 객체 타입
```tsx
type Arr = number[];
type CopyArr = {


[Key in keyof Arr]: Arr[Key];
  };
  const copyArr: CopyArr = [1, 3, 9];

  - `CopyArr` 타입에 존재하는 모든 속성을 숫자 배열이 가지고 있으므로 구조적으로 동일하다

  ```tsx
  type SimpleArr = { [key: number]: number; length: number };
  const simpleArr: SimpleArr = [1, 2, 3];

숫자 배열은 SimpleArr 객체 타입에 있는 모든 속성을 가지고 있다 ⇒ 왜?
숫자 배열은 구조적으로 SimpleArr 이라고 볼 수 있기 때문에 대입할 수 있다


구조적으로 동일하지 않으면 서로 대입할 수 없다
interface Money {
  __type: 'money';
  amount: number;
  unit: string;
}

interface Liter {
  __type: 'liter';
  amount: number;
  unit: string;
}

const liter: Liter = { amount: 1, unit: 'liter', __type: 'liter' };
const circle: Money = liter;
// Type 'Liter' is not assignable to type 'Money'.
// Types of property '__type' are incompatible.
// Type '"liter"' is not assignable to type '"money"'.


객체를 구별할 수 있는 속성을 추가하여 서로 대입되지 않도록 할 수 있다
__type 같은 속성을 브랜드 속성이라고 하고
브랜드 속성을 사용하는 것을 브랜딩한다고 표현한다



2.14 제네릭으로 타입을 함수처럼 사용하자

제네릭 표기는 <> 로 하고 인터페이스 이름 바로 뒤에 위치한다
제네릭을 사용해서 중복 제거하기
interface Person {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

interface Zero extends Person {}
interface Nero extends Person {}


<> 안에 들어가는 N과 A가 각각 name, age 에 대입된다


인터페이스, 클래스, 타입 별칭, 함수에도 적용 가능
type Person = {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
};

type Zero = Person;
type Nero = Person;

class Person {
  name: N;
  age: A;
  constructor(name: N, age: A) {
    this.name = name;
    this.age = age;
  }
}

type Zero = Person;
type Nero = Person;

const personFactoryE = (name: N, age: A) => ({
  type: 'human',
  race: 'yellow',
  name,
  age,
});

function personFactoryD(name: N, age: A) {
  return {
    type: 'human',
    race: 'yellow',
    name,
    age,
  };
}

🌟 함수는 함수 선언문과 함수 표현식의 제네릭 표기 위치가 다름

Array도 제네릭 타입

Array
Array 타입은 다음과 같은 꼴로 선언되어 있다
```tsx
interface Array {



  [key: number]: T;
  length: number;
}
```
**→ 제네릭으로 하나의 타입을 여러 방법으로 재사용할 수 있다**

interface 와 type 간 교차 사용도 가능
interface IPerson {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

type TPerson = {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
};

type Zero = IPerson;
interface Nero extends TPerson {}


객체나 클래스의 메서드에 제네릭을 표기할 수도 있다
class Person {
  name: N;
  age: A;
  constructor(name: N, age: A) {
    this.name = name;
    this.age = age;
  }
  method(param: B) {}
}

interface IPerson {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
  method: (param: B) => void;
}


타입 매개변수에 default 값을 지정할 수 있다
interface Person {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

type Person1 = Person;
type Person2 = Person;
type Person3 = Person;


타입 인수를 옵셔널처럼 사용할 수 있고, 지정하지 않은 타입은 기본값 타입이 됨


제네릭도 추론을 통해 타입을 알아낼 수 있다
interface Person {
  type: 'human';
  race: 'yellow';
  name: N;
  age: A;
}

const personFactoryE = (name: N, age: A): Person => ({
  type: 'human',
  race: 'yellow',
  name,
  age,
});

const zero = personFactoryE('zero', 28);


‘zero’는 string, 28은 number 타입으로 추론된다
zero의 타입은 Person
추론을 통해 타입을 알아낼 수 있는 경우 직접 타입을 넣지 않는 경우가 많다


배열을 튜플로 타입 추론되게 하고 싶은 경우

v4.9 이하

function values(initial: readonly T[]) {
  return {
    hasValue(value: T) {
      return initial.includes(value);
    },
  };
}

const savedValues = values(['a', 'b', 'c'] as const);


v5.0 이상
타입 매개변수 앞에 const 수식어를 추가



function values(initial: T[]) {
  return {
    hasValue(value: T) {
      return initial.includes(value);
    },
  };
}

const savedValues = values(['a', 'b', 'c']);


제네릭에 extends 키워드로 제약 걸기
interface Example {
  a: A;
  b: B;
}

type UseCase1 = Example;
type UseCase2 = Example;
type Usecase3 = Example;


타입 매개변수 A는 number 타입이어야 한다는 의미
UseCase1 은 A 타입에 string 타입을 대입할 수 없으므로 에러 발생
UseCase2 처럼 더 구체적인 타입은 대입 가능
📌 다음과 같이 하나의 타입 매개변수를 다른 타입 매개변수의 제약으로 사용할 수도 있다

interface Example {
    a: A,
    b: B,
}

 // 모든 객체
 // 모든 배열
 any> // 모든 함수
 any> // 생성자타입
 // string | number | symbol


타입 매개변수와 제약을 동일하게 생각하지 않기
interface V0 {
  value: any;
}

const returnV0 = (): T => {
  return { value: 'test' };
};


T는 V0에 대입할 수 있는 모든 타입을 의미하므로 에러가 발생함
{ value: string, another: string} 도 대입할 수 있기 때문
다음과 같이 해결 가능const returnV0 = (): V0 => {
  return { value: 'test' };
};

왜 에러가 난다는 거지



function onlyBoolean(arg: T = false): T {}


false 기본값 지정에서 에러가 발생하는데
never 를 모든 타입에 대입할 수 있다
따라서 T가 never 타입일 수도 있기 때문에 false 기본값이 불가능하다


다음과 같이 제네릭 쓰지 않고 해결 가능function onlyBoolean(arg: true | false = false): T {}





2.15 조건문과 비슷한 컨디셔널 타입이 있다

조건에 따라 타입을 다르게 지정할 수 있다type A1 = string;
type B1 = A1 extends string ? number : boolean;


타입 검사를 위해 사용하기type Result = 'hi' extends string ? true : false;
type Result = [1] extends [string] ? true : false;

type ChooseArray = A extends string ? string[] : never;
type StringArray = ChooseArray;
type Never = ChooseArray;


제네릭과 never 같이 사용하여 필터링 조건에 부합한 경우만 사용하고자 하는 타입 지정하기


컨디셔널 타입과 함께 사용하기
type OmitByType = {
  [K in keyof O as O[K] extends T ? never : K]: O[K];
};

type Result = OmitByType;

/*
type Result = {
    name: string;
    age: number;
}
*/


boolean인 속성을 제거하는 예시


검사하려는 타입이 제네릭이면서 유니언이면 분배법칙이 실행된다
type Start = string | number;
type Result = Key extends string ? Key[] : never;
let n: Result = ['hi'];


Result → Result | Result → string extends string ? string[] : never |  number extends string ? number[] : never→ string[] | never→ string[]
단, boolean 에 분배 법칙이 적용될 때에는 string[] | boolean[] 같은 형태가 아닌 string[] | true[] | false[] 가 됨


분배 법칙 막기type IsString = T extends string ? true : false;
type Result = IsString;


Result 타입이 true | false 이기 때문에 boolean 타입이 됨
다음과 같이 분배 법칙을 막아 해결하자type IsString = [T] extends [string] ? true : false;
type Result = IsString;


배열로 제네릭을 감싸면 분배 법칙이 일어나지 않는다




never 타입도 분배 법칙의 대상이 된다
never 는 공집합과 같으므로 공집합에서 분배 법칙을 실행하는 것은 아무것도 실행하지 않는 것과 같다type R = T extends string ? true : false;
type RR = R;
// type RR = never


컨디셔널 타입에서 제네릭과 never가 만나면 never 가 된다
never 사용할 때 분배 법칙 막기type IsNever = [T] extends [never] ? true : false;
type T = IsNever;
// type T = true
type F = IsNever;
// type F = false




제네릭이 들어 있는 컨디셔널 타입은 값의 판단이 미루어진다
function test(a: T) {
    type R = T extneds string ? T : T;
    const b: R = a;
}

// Type 'T' is not assignable to type 'R'


변수 b에 a를 대입할 때는 R 타입을 모르는 상태이다
해결
function test(a: T) {
    type R = [T] extneds [string] ? T : T;
    const b: R = a;
}

// Type 'T' is not assignable to type 'R'


타입 매개변수를 선언할 때 [T] extneds [string] 하는 것이 불가능하다?
그래서 컨디셔널 타입으로 선언

week2/taerim.html.body:
2.1 변수, 매개변수, 반환값에 타입을 붙이면 된다

그러나 타입을 붙이지 않아도 타입 추론을 사용할 수 있다

2.2 타입 추론을 적극 활용하자

타입스크립트의 추론을 어떻게 활용할 수 있을까?
타입스크립트가 타입을 제대로 추론하면 그대로 쓰고, 틀리게 추론할 때만 올바른 타입을 표기한다


let , const 를 사용할 경우 같은 변수임에도 타입이 다르게 추론될 수 있다
{} 타입은 객체를 의미하는 것이 아니라 null 과 undefined 를 제외한 모든 타입을 의미한다
null 과 undefined 를 let 변수에 대입할 때는 any 로 추론한다
typeof sym 은 고유한 symbol, unique symbol을 의미하고 unique symbol끼리는 서로 비교할 수 없다
unique symbol과 일반 symbol, 일반 symbol과 일반 symbol은 비교 가능
This comparision appears to be unintentional because th types 'typeof sym1' and typeof sym2' have no overlap


타입 추론과 타입 넓히기를 적극 활용해 보자
타입스크립트의 에러를 무시하는 방법
@ts-ignore
@ts-expect-error
@ts-expect-error를 사용하는 것이 다음 줄의 코드에 확실히 에러가 있다는 것을 알리기 때문에 더 낫다



2.3 값 자체가 타입인 리터럴 타입이 있다
let str: 'hello' = 'hello';
let str: string = 'hello'; // 주로 이렇게 자료형 타입으로 사용하는 게 일반적이긴 하지


as const 접미사를 사용하면 타입이 고정되어 추론된다const obj = { name: 'zero' } as const;
// const obj: {
//     readonly name: "zero";
// }


주로 리터럴 타입을 사용하고자 할 때
readonly 수식어가 붙은 값은 변경할 수 없다



2.4 배열 말고 튜플도 있다

빈 배열은 any[] 로 추론된다
배열 추론의 한계const array = [123, 4, 56];
array[3].toFixed();
// array[3]은 존재하지 않아 undefined인데도 toFixed 메소드를 사용해도 컴파일 에러 발생하지 않음

→ 튜플을 사용하여 해결할 수 있음
튜플: 각 요소 자리에 타입이 고정되어 있음
const tuple: [number, string, boolean] = [1, 'yes', true];
tuple[3].toFixed();
// Object is possibly 'undefined'.


표기하지 않은 세 번째 인덱스부터는 undefined 타입으로 추론됨
but push , pop 등의 메소드로 배열의 요소 추가/제거하는 것이 가능함
방지하려면 readonly 키워드 사용



const tuple2: [number, ...string[], number] = [1, 'hello', 'hi', 22];


…타입[] 표기로 특정 타입이 연달아 나올 수 있다는 것을 타입으로 설정 가능


값에도 구조 분해 할당 사용 가능, 여기서도 자동 타입 추론됨
const arr = [123, 4, 56, true];
const arr2 = [...arr, 'hi']; // const arr2: (string | number | boolean)[]


구조분해 할당 사용할 때 나머지 속성(rest property) 문법도 사용할 수 있는데 여기서도 타입 추론
const [a, ...rest] = arr;
// const a: number | boolean
// const rest: (number | boolean)[]

const [b, ...rest2] = [1, 2, 3, 'd'];
// const b: number
// const rest2: [number, number, string]


여기서는 arr이 (number | boolean)[] 이기 때문에 a가 number | boolean 값으로 추론된다


튜플에 옵셔널도 사용할 수 있다
[number, boolean?, string?] 타입에는 [number, boolean, string] , [number, boolean] , [number] 의 값이 올 수 있다
[number, string] 타입은 쓸 수 없음.



2.5 타입으로 쓸 수 있는 것을 구분하자

내장 객체는 타입으로 사용할 수 있지만 String, Object, Number, Boolean, Symbol은 string, object, number, boolean, symbol을 사용하는 것을 권장한다
Number 간 연산자 사용 불가능
string과 String 호환 불가능
Object 타입에는 문자열 대입 가능 등


함수의 반환값을 타입으로 사용하고 싶을 때는 ReturnType 참고 (3.3절이라 추후 공부..)
클래스는 typeof 연산자 없이 타입으로 사용 가능

2.6 유니언 타입으로 OR 관계를 표현하자

유니언 타입: 하나의 변수가 여러 타입을 가질 수 있는 것
(string | number)[] 과 string | number[] 의 차이에 유의하기
타입 좁히기(Type Narrowing): 유니언 타입으로부터 정확한 타입을 찾아내는 기법
특정 타입에만 사용할 수 있는 메소드를 사용할 때는 타입 좁히기를 통해 사용하면 된다function getNumber(str: number | string) {
  if (typeof str === 'number') {
    return str;
  }
  return parseInt(str);
}


타입 앞에도 | 연산자를 사용할 수 있음 (여러 줄에 걸쳐서 유니언 표기할 때)type Union = string | number | boolean;



2.7 타입스크립트에만 있는 타입을 배우자

any
any를 사용하면 타입을 검사하지 못하므로 타입스크립트를 사용하는 의미가 퇴색됨
any를 사용하면 그 이후로도 계속 any 타입이 생성된다
→ 지양하자
타입스크립트가 any로 추론하는 타입은 직접 타입을 표기하자
그런데 any[] 로 추론된 배열은 요소가 추가될 때마다 추론되는 타입이 바뀐다고 한다!
pop으로 요소를 제거할 때 이전 추론으로 돌아가는 것은 아니다


연산 시 타입 추론이 string, number로 변하기도 한다
JSON.parse 나 fetch 는 명시적으로 any를 반환하므로 타입을 명시해 주어야 한다
-


unknown
unknown 타입을 지정하면 어떠한 동작도 수행할 수 없다?!
try-catch 문에서 unknown 타입을 확인할 수 있고, catch(e)의 e에 접근하고 싶을 땐 Type Assertion으로 타입 강제 지정try {
} catch (e) {
  const error = e as Error;
  // 또는
  const error = e;
}


<>를 사용할 수 있지만 react jsx 문법과 충돌하므로 as로 타입 주장을 권장


진짜 안 되는 것 강제 주장 방법: unknown으로 주장한 뒤에 원하는 타입으로 다시 주장하기
const a: number = '123' as unknown as string
! 연산자 사용 예시는 param!.slice(3) 이 맞는 건가?


void
함수의 반환값을 무시하도록 하는 특수한 타입
반환값 없는 함수의 리턴 타입은 자동으로 void 추론
반환값이 void 타입인 함수가 undefined가 아닌 반환값을 리턴하게 만들 수는 있음, 그렇지만 반환값이 void이기 때문에 사용하지 못함
forEach 콜백 함수에 사용됨




{}, Object
{}, Object: null과 undefined를 제외한 모든 값
if 문 안에서 unknown과 {}로 분류됨


never

어떤 타입도 대입할 수 없음
함수 선언문과 함수 표현식에서 각각 throw 에러를 던지면 반환값의 타입은 void, never
function result() {
  throw new Error(); // void type
}

const result2 = () => {
  throw new Error(); // never type
};


무한 반복문이 들어 있는 함수처럼 값을 반환하지 않는 경우도 반환값이 never
이 경우에도 함수 표현식일 때만 never


함수 선언문에서 void 추론될 때는 never로 표기하여 사용
if-else로 타입 좁히기 사용할 경우에도 해당 변수의 모든 타입이 성립하지 않을 경우에는 never 타입
const param: number | string = '';

if (typeof param === 'number') {
} else if (typeof param === 'string') {
} else {
  param;
  // 여기서 param은
}





2.8 타입 별칭으로 타입에 이름을 붙이자

type 키워드를 사용하여 타입 별칭 지정 가능
관습은 대문자로 시작하는 파스칼 케이스
타입 표기가 길어질 때, 주로 함수/객체/배열을 사용할 때 가독성과 재사용 측면에서 사용하면 좋다

2.9 인터페이스로 객체를 타이핑하자

인터페이스 선언: 타입 별칭처럼 객체 타입에 이름을 붙일 수 있는 또 다른 방법
타입 별칭과 마찬가지로 관습은 대문자로 시작하는 파스칼 케이스
인덱스 시그니처
[key: string]
```tsx
interface Arr {
  length: number;
  name: string;
  address: string;
  email: string;
  introduce: string;
}
// 다음과 같이 쓸 수 있음
interface Arr {
  length: number;


[key: string]: string;
  }
- 인터페이스 선언 병합
  - 같은 이름으로 인터페이스 여러 번 선언하는 경우는 하나로 합쳐짐
  - 인터페이스 확장을 위함
  ```tsx
  interface Merge {
    one: string;
  }

  interface Merge {
    two: number;
  }

  // 다음과 같음

  interface Merge {
    one: string;
    two: number;
  }

속성을 겹치게 설정할 수는 없음 ⇒ 에러 발생
네임스페이스


의도치 않은 인터페이스 선언 병합을 방지하여 사용할 수 있음
export 해야 사용 가능
중첩해서 사용 가능
namespace Example {
  export namespace Outer {
    export interface Inner {
      test: string;
    }
    export type test2 = number;
  }
  export const a = 'real';
}

const obj: Example.Outer.Inner = { test: 'hello' };


내부에 값을 선언했다면 값으로도 선언 가능
동일한 이름을 가진다면 인터페이스처럼 병합됨

week2/donghyeok.html.body:
2주차 스터디 내용 정리
출처이 내용은 타입스크립트 교과서 책을 읽고 스터디한 내용을 바탕으로 정리했습니다.


2주차 스터디 내용 정리
2.10 객체의 속성과 메서드에 적용되는 특징을 알자
